import React, { Component } from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Route,
} from 'react-router-dom';

import ClientChart from './Components/ClientComponent/ClientsChart';
import HitRatioChart from './Components/HitRatioComponent/HitRatioChart';
import MemoryChart from './Components/MemoryComponent/MemoryChart';
import PerformanceChart from './Components/PerformanceComponent/PerformanceChart';
import Login from './Components/Login';
import HomePage from './Components/HomePage';

class App extends Component {
  render() {
    return (
      <Router>
          <div className="App">
             <Route exact path="/" component={Login} />
             <Route exact path="/Client" component={ClientChart} />
             <Route exact path="/Hitratio" component={HitRatioChart} />
             <Route exact path="/Memory" component={MemoryChart} />
             <Route exact path="/Performance" component={PerformanceChart} />
             <Route exact path="/Home" component={HomePage} />
          </div>
      </Router>
    );
  }
}

export default App;
